import React from 'react'
import hero from '../assets/GAMING.jpg'

const Hero = () => {
  return (
    <section id='home' className='min-h-screen flex py-10 md:flex-row flex-col items-center '>
      <div>
        <img src={hero} alt="" className='md:w-11/12 h-full object-cover' />
      </div>
    </section>
  )
}

export default Hero
